import * as React from "react";
import { AppData } from "./appdata";

const Summary = () => {
  let { state, dispatch } = React.useContext(AppData);
  return (
    <React.Fragment>
      <section className="res-summary res-editable" id="Summary">
        <h2 className="note rr poly-wrap">Summary</h2>

        <div class="sticky note-card rr">
          <h4 class="tack">
            <i class="inner"></i>
            <span class="can-edit">What I do:</span>
          </h4>
          <div
            class="note-card-text pretty-scroll can-edit"
            dangerouslySetInnerHTML={{ __html: state.resume.summary }}
          ></div>
        </div>
      </section>
    </React.Fragment>
  );
};

export default Summary;
